import React from "react";
import ReactDOM from "react-dom/client";

function APP() {
  return (
    <div>
      <Header />
      <Pizza />
      <Pizza />
      <Pizza />
      <Footer />
    </div>
  );
}

function Header() {
  return (
    <header>
      <h1>Pizza Store</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>Menu</li>
          <li>About</li>
        </ul>
      </nav>
    </header>
  );
}

function Menu() {
  return (
    <div>
      <h2>Menu</h2>
      <ul>
        <li>Pizza Spinaci</li>
        <li>Pizza Margherita</li>
        <li>Pizza Focaccia</li>
      </ul>
    </div>
  );
}

function Footer() {
  return (
    <footer>
      <p>Copyright 2022</p>
    </footer>
  );
}

const Test = () => {
  return (
    <div>
      <h1>Test</h1>
      <Pizza />
    </div>
  );
};

function Pizza() {
  return (
    <div>
      <img src="pizzas/spinaci.jpg" alt="Pizza spinaci" />
      <h2>Pizza</h2>
      <p>This is a pizza.</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <APP />
  </React.StrictMode>
);
